webpackJsonp([0xed5128e5a7aa],{4894:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Founding the Business",date:"14 Apr 2007",slug:"/2007-04-14-founding-the-business/",tags:"Y2007"},html:'<p><a href="http://www.flickr.com/photos/papascott/458505383/" title="Photo Sharing"><img src="http://farm1.static.flickr.com/211/458505383_869cae7c37.jpg" width="500" height="375" alt="IMG_1964" /></a></p>\n<p>As you can see, we\'ve started setting up our business. </p>\n<p>In the upper left you can see the two founders. They are stubborn as donkeys, and have already dressed warm (*haben sich warm angezogen*) in preparation for the tough times ahead. Between them is a crystal ball with a vision of the future.</p>\n<p>To their right is a device for cutting costs. If twisted just right it can also be used to cut corners. On the shelf beneath them we are trying to bring light into the darkness. </p>\n<p>(Hmm, somehow this seemed much funnier when we were cleaning out the shelf. But the two binders to the left are really our first business files.)</p>'},next:{fields:{title:"Cem's Back",date:"14 Apr 2007",slug:"/2007-04-14-cems-back/"}},previous:{fields:{title:"Euro License",date:"15 Apr 2007",slug:"/2007-04-15-euro-license/"}}},{node:{fields:{title:"Cem's Back",date:"14 Apr 2007",slug:"/2007-04-14-cems-back/",tags:"Y2007"},html:'<p>Cem Basman is blogging again (in German) at <a href="http://sprechblase.wordpress.com/">Sprechblase</a>. He\'s not sure what he wants to do, but <a href="http://sprechblase.wordpress.com/2007/04/13/ja-es-macht-viel-mehr-spass/">he\'s having fun</a> and <em>Der Weg ist das Ziel</em> and all that. I hope he posts more memories of <a href="http://sprechblase.wordpress.com/2007/04/12/konigsblau/.">growing up in Instanbul</a> Welcome back, and keep having fun.</p>'},next:{fields:{title:"Mac OS X 10.5 Leopard delayed until October",date:"13 Apr 2007",slug:"/2007-04-13-mac-os-x-105-leopard-delayed-until-october/"}},previous:{fields:{title:"Founding the Business",date:"14 Apr 2007",slug:"/2007-04-14-founding-the-business/"}}},{node:{fields:{title:"Mac OS X 10.5 Leopard delayed until October",date:"13 Apr 2007",slug:"/2007-04-13-mac-os-x-105-leopard-delayed-until-october/",tags:"Y2007"},html:'<p>Apple <strike>Computer</strike>: <a href="http://www.prnewswire.com/cgi-bin/stories.pl?ACCT=104&amp;STORY=/www/story/04-12-2007/0004564657&amp;EDATE=">Leopard delayed</a>. The funny thing is at work we were actually planning Mac OS X Server implementations based on Leopard being out by summer. At the meeting I was muttering "Vapor, vapor, vapor" under my breath. I wish I had muttered it out loud so I could tell everyone I told you so. (via <a href="http://vowe.net/archives/008361.html">vowe</a>)</p>'},next:{fields:{title:"Coffee and the German Banking System",date:"13 Apr 2007",slug:"/2007-04-13-coffee-and-the-german-banking-system/"}},previous:{fields:{title:"Cem's Back",date:"14 Apr 2007",slug:"/2007-04-14-cems-back/"}}}],pathPrefix:"",first:!1,last:!1,index:141,pageCount:1101}}}});
